VALUES ('4008799101416', 'Maracuja Nektar', 'Eau, jus de fruit de la passion à base de concentré, sucre. Bien agiter avant ouverture. Après ouverture, se conserve au frais pendant 2-3 jours. Conserver au frais et au sec, a l\'abri de la lumière et le gel. Quand l\'emballage est fermé, a consommer de préférence avant le: voir en haut @Nettare di maracuja da concentrato. Frutta: 25% minimo. Ingredienti: acqua, succo di maracuja da concentrato, zucchero. Agitare prima dell\'uso. Dopo l\'apertura conservare in I frigorifero e consumare entro 2-3 giorni. Conservare in luogo fresco e asciutto. Proteggere da sole e gelo, Sigillato da consumarsi preferibilmente entro il: vedi sopra @Passionsfrugtnektar fra koncentrat. Frugtindhold: mindst 25%. Ingredienser: vand, Passionsfrugtsaft fra koncentrat, sukker. 2mrystes for', '', '0.5', '0.1', '12', '12', '', '0.5', '0', '0', '', '1');

